  "continuation": "la breve edad al rayo matutino;\nantes que en el oriente el sol decline,\nya es tesoro del mar lo que fue aurora.\nAsí la rosa que al abrirse aún pino\nvida respiró hermosa, y peregrina\ngloria del mayo, a breve tiempo llora."
